      - m_Id: 38119814135275521
        m_Localized: "El tama\xF1o predeterminado del cuadro de secci\xF3n afecta el
      tama\xF1o del cuadro de secci\xF3n del conflicto.\n\nPara los conflictos individuales,
      MyProject compila el cuadro de secci\xF3n m\xE1s peque\xF1o que incluye ambos
      objetos incoherentes. Si el ancho, el alto o la profundidad del cuadro exceden
      los l\xEDmites predeterminados del tama\xF1o del cuadro, el cuadro se reduce
      para ajustarse a ese l\xEDmite.\n\nPara los grupos de conflictos, MyProject compila
      el cuadro de secci\xF3n m\xE1s peque\xF1o que rodea todos los cuadros de secci\xF3n
      de los conflictos individuales. Si se selecciona la casilla de verificaci\xF3n
      \"La altura del cuadro se define con los niveles adyacentes\", la altura del
      cuadro se ajusta DESPU\xC9S de que se aplica el l\xEDmite predeterminado de
