      operadores Y se ejecutan antes que los operadores O.\n\nPor ejemplo,\n\n condici\xF3n1
      O condici\xF3n2 Y condici\xF3n3\n\nse ejecuta de la siguiente manera:\n\n condici\xF3n1
      O (condici\xF3n2 Y condici\xF3n3)\n\nSin embargo, en los escenarios m\xE1s
      comunes es posible que desee ejecutar las condiciones Y despu\xE9s de las condiciones
      O: \n\n (condici\xF3n1 O condici\xF3n2) Y condici\xF3n3\n\nPara lograrlo, agrupe
      las condiciones unidas con O."
