      profundidad del cuadro supera el l\xEDmite de tama\xF1o de cuadro predeterminado,
      el cuadro se recorta para ajustarse al l\xEDmite.\n\nPara los grupos de conflictos,
      MyProject compila el cuadro de secci\xF3n m\xE1s peque\xF1o que rodea todos los
